def getListOfFiles(dir: String) = {
    val d = new File(dir)
    if (d.exists && d.isDirectory) {
        d.listFiles.filter(_.isFile).toList
    } else {
        List[File]()
    }
}

def getListOfFolders(dir: String) = {
    val d = new File(dir)
    if (d.exists && d.isDirectory) {
        d.listFiles.filter(!_.isFile).toList
